import React from 'react'
import { useParams } from 'react-router-dom'

const ProductScreen = () => {
    const params = useParams();
    const { slug } = params;
    return (
        <div>
            <h1 style={{ background: "red", width: "500px", marginTop: "300px" }}>{slug}</h1>
        </div>
    )
}

export default ProductScreen
